import {Link, useLocation} from "react-router-dom";
import db from "../Database";
import "../index.css"

function Dashboard() {
    const courses = db.courses;
    const pathname = useLocation();
    return (
        <div>
            <Kanbas/>
            <h1>Dashboard</h1>
            <div className="wd-flex-row-container wd-float-right">
                {courses.map((course) => (
                        <div className="card wd-dashboard-padding card-width">
                        <img className="card-img-top" src="../../blue.jpeg"
                             width={"200"} height={"200"}></img>
                            <Link
                                key={course.id}
                                className={`nav-link card-link`}
                                to={`/Kanbas/Course/${course.id}`}> {course.name}: {course.number}
                    </Link>
                        </div>
                ))}
            </div>
        </div>
    );
}
export default Dashboard;
